import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import ListGroup from 'react-bootstrap/ListGroup';
import Card from 'react-bootstrap/Card';
import React from "react";

function App() {
    return (
        <div className="App">
            <header className="App-header">
            </header>
            <Container>
                <Row>
                    {/*compnet*/}
                    <Col>
                        <input/>
                    </Col>
                </Row>
                <input className="DocSearch-Input" aria-autocomplete="both" aria-labelledby="docsearch-label" id="docsearch-input" autoComplete="off" autoCorrect="off" autoCapitalize="off" enterkeyhint="go" spellCheck="false" placeholder="Search docs" maxLength="64" type="search" value="gra" wfd-id="id0" aria-activedescendant="docsearch-item-0" aria-controls="docsearch-list"/>
                <Row className="text-center">
                    {/*compnet*/}
                    <Col xs={6}>
                        <Card>
                            <ListGroup variant="flush">
                                <ListGroup.Item>Cras justo odio</ListGroup.Item>
                                <ListGroup.Item>Dapibus ac facilisis in</ListGroup.Item>
                                <ListGroup.Item>Morbi leo risus</ListGroup.Item>
                                <ListGroup.Item>Porta ac consectetur ac</ListGroup.Item>
                            </ListGroup>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </div>
    );
}

export default App;
